import React from 'react';
import { NavLink } from 'react-router-dom';
import { Brain } from 'lucide-react';

const Header = () => (
  <nav className="flex items-center justify-between p-4 bg-white shadow-sm border-b">
    <div className="flex items-center space-x-2 cursor-pointer">
      <Brain className="w-8 h-8 text-primary" />
      <NavLink to="/" className="text-xl font-semibold hover:text-primary">
        ClinicalAI
      </NavLink>
    </div>
    <div className="flex items-center space-x-8">
      <NavLink
        to="/solutions"
        className={({ isActive }) =>
          isActive ? 'text-primary' : 'text-gray-600 hover:text-primary'
        }
      >
        Solutions
      </NavLink>
      <NavLink
        to="/benefits"
        className={({ isActive }) =>
          isActive ? 'text-primary' : 'text-gray-600 hover:text-primary'
        }
      >
        Benefits
      </NavLink>
      <NavLink
        to="/about"
        className={({ isActive }) =>
          isActive ? 'text-primary' : 'text-gray-600 hover:text-primary'
        }
      >
        About
      </NavLink>
      <NavLink
        to="/dashboard"
        className={({ isActive }) =>
          isActive ? 'text-primary' : 'text-gray-600 hover:text-primary'
        }
      >
        Dashboard
      </NavLink>
      <NavLink
        to="/request-demo"
        className="px-4 py-2 text-white bg-primary rounded-full hover:bg-blue-700"
      >
        Request Demo
      </NavLink>
    </div>
  </nav>
);

export default Header;
